SELECT title
FROM publication
ORDER BY title ASC;

SELECT EXTRACT(DAY
               FROM AGE(MAX(admit_term), CURRENT_DATE)) AS days_since_last_admission
FROM student;

SELECT COUNT(*) AS number_of_students_predicted_to Graduate
FROM student
WHERE predicted_graduation_semester >= NOW() - INTERVAL '10 years';

SELECT name
FROM course
WHERE department = 'Computer Science';

SELECT c.name AS course_name,
       (c.num_enrolled::numeric / COALESCE(c.num_reviews, 1)) AS student_review_ratio
FROM course c;

SELECT course_id,
       (clear_grading::float / COALESCE(good_feedback, 1)) AS ratio
FROM course_tags_count;

SELECT EXTRACT(DAY
               FROM AGE(NOW(), MIN(departure_time))) AS days_difference
FROM flight;

SELECT COUNT(*) AS round_trip_fares_count
FROM fare
WHERE round_trip_required = 'Yes';

SELECT minimum_connect_time
FROM airport
WHERE airport_code = 'JFK';

SELECT a.aircraft_code,
       a.capacity::numeric / a.range_miles AS capacity_to_range_ratio
FROM aircraft a;

SELECT state_name
FROM state
WHERE population < 100000;

SELECT state_name
FROM lake
WHERE lake_name = 'Lake Ontario';

SELECT name
FROM restaurant
WHERE food_type = 'Italian';

SELECT (COUNT(*) FILTER (
                         WHERE rating > 4.5) * 1.0 / COUNT(*)) AS ratio
FROM restaurant;

SELECT journalname
FROM journal
ORDER BY LENGTH(journalname) ASC;

SELECT name
FROM business
ORDER BY name ASC;
